import React from 'react';
import {Link} from 'react-router-dom'
const Header = () => {
    return ( 
        <React.Fragment>
            <div className='logo'>
            </div>
            <div className='login-button'>
                <Link to="/">Đăng nhập</Link>
            </div>
        </React.Fragment>
     );
}
 
export default Header;
